import Vue from 'vue';
import VueRouter from 'vue-router';
import Home from "./pages/home";
import store from "./store";

var Favorites = function Favorites() {
  return import("./pages/favorites");
};

Vue.use(VueRouter);
var routes = [{
  path: '/favorites',
  component: Favorites,
  meta: {
    requiresAuth: true
  }
}, {
  path: '*',
  component: Home,
  meta: {
    requiresAuth: true
  }
}];
var router = new VueRouter({
  mode: 'history',
  routes: routes,
  // short for `routes: routes`
  store: store
});
export default router;
